label("$y$",(0,1.2),NE);

P = rotate(60)*A;

D = foot(P,A,-A);

draw(O--P--D);

draw(rightanglemark(O,D,P,2));

draw(Circle(O,1));

label("$O$",O,SE);

label("$P$",P,NE);

//label("$A$",A,SE);

label("$D$",D,S);

[/asy]

